import React from 'react';
import { FaStar } from 'react-icons/fa';
function Stars({ length = 5 }) {
  const createArray = (length) => [...Array(length)];
  return [
    <FaStar color="red" />,
    <FaStar color="red" />,
    <FaStar color="red" />,
    <FaStar color="grey" />,
    <FaStar color="grey" />,
  ];
}

export default Stars;
